import React from "react";
import {Button, Icon} from 'antd';

const settings = {
  position: 'absolute',
  top: '50%',
  right: 0,
};

const AntSetting = () => (
  <Button shape="circle" icon="download" style={settings} />
);

export default AntSetting;
